import React from 'react';
import './About.css';
import profileImage from '../../assets/images/profile.webp';
import awsDeveloperLogo from '../../assets/images/awsdeveloper.png';
import awsCloudPractitionerLogo from '../../assets/images/awspractioner.png';
import IconCloud from "@/components/magicui/icon-cloud";
import { motion } from 'framer-motion';

const slugs = [
  "figma", "html5", "css3", "javascript", "react", "django", "java", "amazonaws",
  "visualstudiocode", "git", "vercel", "express", "androidstudio", "redux",
  "python", "mysql", "mongodb", "firebase", "sass"
];

const IconCloudDemo = () => (
  <div className="icon-cloud-container">
    <IconCloud iconSlugs={slugs} />
  </div>
);

const About = () => {
  return (
    <div className="about-container">
      <motion.section 
        className="about-section"
        initial={{ opacity: 0, y: 50 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8 }}
      >
        <h2 className="section-title">About Me</h2>
        <div className="about-content">
          <motion.img 
            src={profileImage} 
            alt="Chirag" 
            className="profile-image"
            whileHover={{ scale: 1.05 }}
            transition={{ type: "spring", stiffness: 300 }}
          />
          <div className="about-text">
            <p>Hey there! I'm Chirag, a dedicated full-stack web developer with a passion for cloud technologies. Graduating from Sahyadri College with a degree in Information Science and Engineering, I'm equipped with the skills and knowledge to tackle the digital world's challenges.</p>
            <motion.ul
              initial="hidden"
              animate="visible"
              variants={{
                hidden: { opacity: 0 },
                visible: {
                  opacity: 1,
                  transition: {
                    delayChildren: 0.3,
                    staggerChildren: 0.2
                  }
                }
              }}
            >
              {[
                "Mastering AWS certifications to stay ahead in cloud computing",
                "Debugging code swiftly and efficiently",
                "Pushing boundaries through intense problem-solving sessions",
                "Writing JavaScript and perfecting Python scripts"
              ].map((item, index) => (
                <motion.li
                  key={index}
                  variants={{
                    hidden: { y: 20, opacity: 0 },
                    visible: { y: 0, opacity: 1 }
                  }}
                >
                  {item}
                </motion.li>
              ))}
            </motion.ul>
          </div>
        </div>
      </motion.section>

      <motion.section 
        className="certification-section"
        initial={{ opacity: 0, y: 50 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8, delay: 0.2 }}
      >
        <h2 className="section-title">Certifications</h2>
        <div className="certifications">
          {[
            { logo: awsDeveloperLogo, title: "AWS Certified Developer â€“ Associate", description: "Proficiency in developing, deploying, and debugging cloud-based applications using AWS." },
            { logo: awsCloudPractitionerLogo, title: "AWS Certified Cloud Practitioner", description: "Comprehensive understanding of AWS Cloud concepts, services, security, architecture, pricing, and support." }
          ].map((cert, index) => (
            <motion.div 
              key={index}
              className="certification"
              whileHover={{ scale: 1.05, boxShadow: "0px 10px 30px rgba(0,0,0,0.1)" }}
            >
              <img src={cert.logo} alt={cert.title} />
              <h3>{cert.title}</h3>
              <p>{cert.description}</p>
            </motion.div>
          ))}
        </div>
      </motion.section>

      <motion.section 
        className="skills-section"
        initial={{ opacity: 0, y: 50 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8, delay: 0.4 }}
      >
        <h2 className="section-title">Skills</h2>
        <IconCloudDemo />
        <div className="skills-grid">
          {[
            "Front-End Development: HTML, CSS, JavaScript, React",
            "Back-End Development: Django, Express.js, Java",
            "Cloud Computing: AWS services",
            "Development Tools: Git, VS Code, Android Studio, Vercel",
            "Design: Figma"
          ].map((skill, index) => (
            <motion.div
              key={index}
              className="skill-item"
              initial={{ opacity: 0, scale: 0.8 }}
              animate={{ opacity: 1, scale: 1 }}
              transition={{ duration: 0.5, delay: index * 0.1 }}
            >
              {skill}
            </motion.div>
          ))}
        </div>
      </motion.section>
    </div>
  );
};

export default About;
